import Sumary from './mainpages/content/Sumary';


export default function About() {
    return <>
        <div className='yugitoken'>
            <div className="heading white-heading" style={{ padding: "50px" }, { fontSize: "60px" }}>YGO TOKEN</div>
        </div>

        <PieChart />
        <hr style={{ border: '5px solid #000' }} />
        <ScrollButton />
        <Sumary />
        <Footer />
    </>;
}
